import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
    // width: 35%;
    // margin: auto;
    // align: center;
    border: 2px solid green;
    align: center;

    .choice{
        margin 0 5% 0 5%
    }
`

export default Wrapper
